import React, { useEffect, useState } from 'react';

const Feed = () => {
  const [userDataResult, setUserDataResult] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true)

  useEffect(() => {
    const fetchUserData = async () => {
      const url = 'https://instagram120.p.rapidapi.com/api/instagram/profile';
      const options = {
        method: 'POST',
          headers: {
            'content-type': 'application/json',
            'X-RapidAPI-Key':
              '12eaa2c047msh237261d4664f961p17b89djsn90feffa1c8d3',
            'X-RapidAPI-Host': 'instagram120.p.rapidapi.com',
          },
        body: JSON.stringify({
          username: 'instagram',
        }),
      };

      try {
        const response = await fetch(url, options);
        if (!response.ok) {
          throw new Error('Failed to fetch');
        }
        const result = await response.json();
        setUserDataResult(result);
        console.log('result: ', result);
      } catch (error) {
        setError(error.message);
      } finally {
        setLaoding(false);
      }
    };

    fetchUserData();
  }, []);

  return (
    <div>
      {error && <div>Error: {error}</div>}
      {userDataResult && (
        <div>
          <p>Username: {userDataResult.content_type}</p>
          {/* Add more user data properties here */}
        </div>
      )}
    </div>
  );
};

export default Feed;
